description:
Verenigde Staten
Horror
89 minuten

een goeie film

met Michael McMillian, Jessica Stroup en Daniella Alonso

Een team van jonge en onervaren National Guard-soldaten krijgt de missie om apparatuur te brengen naar een onderzoekskamp in de 
woestijn. Maar hier aangekomen ontdekken de soldaten dat het kamp volledig verlaten is. Als ze dan vreemde geluiden horen op 
hun walkietalkies, besluiten ze op onderzoek uit te gaan. Ze vinden dan echter al snel een groep gruwelijk misvormde en tevens 
hongerige mutanten.
